(63041,	478,	'eng',	'v',	NULL,	'He said he couldn\'t stand it. He said incredulously. Mushroom break said.',	'“ဒုၚ်နၚ်သၟတ်ဗြဴတုဲ ဇကုဒှ်တၠသ္ၚိရဂးတုဲ ပညံၚ်ရဴဍိက်ကီု ဟီုကလှၚ်တဴက တောဝ်မတ်ရ။ (ဇ—၂၁၉။ အစွောံ။) = “သတို့သမီးကို ခေါ်ဆောင်လာပြီးလျှင် ငါသည် အိမ် ရှင်လင်ယောကျာ်းဖြစ်ပြီဟေ့ဆိုကာ ကျေးကျွန်သဖွယ်ပြု၍ နားမခံသာအောင် ပြောဆိုဆက်ဆံ၏။”',	'2025-10-26 13:42:26',	7),
(63605,	15256,	'eng',	'v',	NULL,	'intervened. entered the forest.',	'“ပ္ဍဲသၟိၚ်တၠကုသဵုၜါ မဟီုပၠန်ဂတးတဴဂှ် ယာံရအဲဟီုသြံက်တိုန်ပၠန်မ္ဂးဂှ် အဲဒှ်အာပူဂဵုအရိုၚ်အဇိုၚ် ဟွံတီဗၞတ်အရေဝ်ဂှ်ပၠန်ရ။” (ဇ—၅၃၃။ အစွောံ။) = “ဘုန်းကံရှင်မင်းနှစ်ပါးတို့ စကားတုံ့လှယ်ပြောဆိုနေကြစဉ် အကျွန်ုပ်ဝင်စွက်ပြောဆိုပါက အကျွန်ုပ်သည် စကားပမာဏကိုမသိသော ရိုင်းစိုင်းသောသူဖြစ်သွားပေလိမ့်မည်။”',	'2025-10-26 13:56:17',	7),
