(63967,	5286,	'eng',	'v',	NULL,	'Said incorrectly. It means that what is said is another.',	'“ၜိုန်မဇကုဟီုတဆူအာကီုလေဝ် ဗောဓိသတ်တၠညာန် ဂြၚ်ဗက်လဟီုသၟိၚ်ဂှ်ဂတာပ်တုဲ ဂွံပခိုၚ် ပ္တိုန်ဂလာန်မဇကုရ။”(ဇ—၂၁၁။ အစွောံ။) = “မိမိဖခင်ချွတ်ယွင်း၍ ဆိုမိသော်ငြားလည်း ဉာဏ်ရှင်ဘုရားလောင်းသည် မင်း၏စကားကို လျင်စွာသိလိုက်သဖြင့် ဖခင်၏စကားကို ခိုၚ်အောင်ပြင် ပြောပေးနိုင်ခဲ့၏။”',	'2025-10-26 14:06:35',	7),
