(66498,	15484,	'eng',	'pali',	NULL,	'(N) Location of the heart. The house of the heart. Heart.',	'“ယွံသၟိၚ်ကၞုဲ၊ — ဓဝ်ပန်သီုဖအိုတ်ဂှ် နွံတဴပ္ဍဲဂၠံဟဒယဝတ္ထုတၠအဲရအဴ” ကျာံထိုၚ်သး။ (ဇ—၅၇။ အစွောံ။) = “မျောက်မင်း၊ အလုံးစုံသောလေးပါးကုန်သောတရားတို့သည် သင်၏နှလုံးသား­ ရှိပေ၏” ဟုမိကျောင်းချီးမွမ်း၏။ || “ပ္ဍဲဟဒယဝတ္ထု ပ္ဍဲစိုတ်အဲတေံ ဓဝ်လအေၚ်အဲမသတဴဂှ် တၞဟ်နမရာတ်ညာတ်ဂှ် ဟွံသၟဟ်ရထရမရာတ်” ရသိဂး။ (ဇ—၃၁၃။ အစွောံ။) = “မင်းမြတ်၊ ငါ၏နှလုံးအိမ် ငါ၏စိတ်ထဲ­တည်ရှိသော ငါ၏သည်းခံခြင်းတရားကို သင်မင်းမြတ်မြင်ခြင်းငှာ မတတ်ကောင်း။”',	'2025-10-26 15:15:54',	7),
