(66717,	15501,	'eng',	'v',	NULL,	'Dissolved. ends terminated. calmed down',	'‘ပၞာန်ဟဲအာရ။’ = ‘စစ်ပြီးဆုံးသွားပြီ။’ || “ထပှ်တ္ၚဲလောန် သဘၚ်နက်သတ်ဂှ် ဟဲအာ။” (ဇ—၁၁၈။ အစွောံ။) = “ခုနစ်ရက်လွန်၍ နက္ခတ်ပွဲသဘင် ပြီးဆုံးသွား၏။” || “(ဣသိဟံၚ်နၚ်သၟတ်ဗြဴဂှ် နူဍာ်ဂၚ်တုဲ) ကဵုၜံၚ်ပၟတ်လၟုဟ်ဟဲတုဲ ကဵုသစ္ဆုမၞုံကုရှ်—။” (ဇ—၆၃။ အစွောံ။) = “ရသေ့သည် သူငယ်မကို မြစ်ရေမှဆယ်တင်ပြီးလျှင် မီးလှုံစေ၏။ အချမ်းပြေသောအခါ အရသာရှိသောသစ်သီးကို ပေး၏။” || “တြုံဒိုက်ဂတ်ဂှ် ဒှ်အၚပ်သၟိက်ဂွံသုၚ်သုရာ၊ ဂွံသုၚ်သုရာညိတုဲ အၚပ်ဟဲအာရ။” = “ဆင်းရဲသားယောကျာ်းသည် အရက်သောက်လိုသော ချင်ခြင်းသည်ဖြစ်၏။ အနည်းငယ်သောအရက်ကိုသောက်ရပြီးနောက် ချင်ခြင်းပြေသွား၏။” || ‘ကျာဗြဲဂှ်ဟဲအာတုဲ တမာတ်ဂမၠိုၚ်ဂှ်ပဝ်စဴ။’ (ဇ—၁၆၄။ အစွောံ။) = ‘မိုးလေစဲသွားပြီးနောက် လင်းတများသည် ပျံ၍နေရပ်ပြန်ကြကုန်၏။’ || “လဗြဴတုန်လေဝ် ဗ္ၜူသုရာဟဲအာရ။” (ဇ—၃၈၈။ အစွောံ။) = “မိန်းမအိုသည်လည်း အရက်မူးပြေသွား၏။” || “(ဂစေံဒဂိုတ်တံဂှ်) ဒှ်တဴဝါတ်ဂါတ်ကဵုရၚ်သ္ကံ ဟွံဟဲရ။” (ဇ—၃၃။ အစွောံ။) =“ထိုငုံးငှက်တို့သည် အချင်းချင်း ခိုက်ရန်ဖြစ်ကုန်၍ ခိုက်ရန်မငြိမ်းဘဲရှိ၏။” || “ကြဴတဲ ယဲဒိုက်ဟဲတုဲ (စဴကၠုၚ်ဂိုၚ်ကေတ်ဒြပ်ဂှ်ရ။)” (ဇ—၁၇၈။ အစွောံ။) = “နောၚ်အနာရောဂါငြိမ်းသည်ရှိသော် ပြန်လာ၍ ထိုဥစ္စာတို့ကိုယူလော့။”',	'2025-10-26 15:22:14',	7),
