(95406,	14552,	'eng',	'v',	NULL,	'He spoke kindly.',	'“ပွမဟီုသၚ်ရိုဟ်တဴ နကဵုဂလာန်မဍိုန်ဍောတ်ဇိပ်ဂၠိပ်မမိပ်ကတောဝ် မပ္တံကဵုမိတ်သဟာဲကောန်သမ္ဘာတုဲ ပွမကဵုဒါန်ဂှ် အဒေါသဒါနမ္ဂးယၟုရ။” (သၚ်္ခါရဘေဒနဳ။ ဝိန္ဒသာရ။) = “အဆွေခင်ပွန်း၊ သားမယားစသူတို့အား သိမ်မွေ့နူးညံ့သော နားဝင်ချိုသာသောစကားဖြင့် ကြင်နာစွာပြောဆိုလျက် အလှူဒါနပြုခြင်းသည် အဒေါသဒါနမည်၏။”',	'2025-10-27 13:15:36',	7),
